import React, { useState } from 'react';
import './Signup.css'; 
import { FaFacebookF, FaGoogle } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navi=useNavigate();

  const handle = (e) => {
    e.preventDefault();
    alert(`Successfully submitted: Email: ${email}, Password: ${password}`);
    setEmail("")
    setPassword("")
  };

  const handlePassword=()=>{
    navi('/')
  }

  return (
    <div className="signup">
      <div>
        <span className='spa'>&alt</span>
      </div>
      <h1>Login</h1>
      <form>
        <label>E-mail</label>
        <input
          type="email"
          value={email}
          placeholder="Enter the email"
          onChange={(e) => setEmail(e.target.value)}
        />

        <label>Password</label>
        <div className="password">
          <input
            type="password"
            value={password}
            placeholder="********"
            onChange={(e) => setPassword(e.target.value)}
          />
          <span className="eye-icon">&#128065;</span>
        </div>

       <p className='for' onClick={handlePassword}>forget password ?</p>

        <button onClick={handle} type="submit" className="signup-btn">
          Login
        </button>
      </form>

      <p className="login-text">
        Don't have an account? <a href="/sign-up">Sign up</a>
      </p>

      <div className="social-signup">
        <p>Sign up with</p>
        <div className="social">
          <button className="fb">
            <FaFacebookF className="icon" /> Facebook
          </button>
          <button className="gg">
            <FaGoogle className="icons" /> Google
          </button>
        </div>
      </div>
    </div>
  );
};

export default Login;
